import React from 'react';
import { Link } from 'react-router-dom'; // For navigation to the About page
import '../css/Home.css'; // Ensure you have this CSS file

const skills = [
  { name: 'Python', level: 90 },
  { name: 'SQL', level: 85 },
  { name: 'Machine Learning', level: 85 },
  { name: 'Data Visualization', level: 90 },
  { name: 'Power BI', level: 85 },
  { name: 'Apache Spark', level: 85 }
];

const projects = [
  {
    title: 'Customer Churn Prediction',
    description: 'Developed a model using Random Forests to predict customer churn and improve retention strategies.',
    link: 'https://github.com/your-repo/customer-churn-prediction',
    image: 'https://via.placeholder.com/400x150?text=Customer+Churn+Prediction'
  },
  {
    title: 'Sales Prediction',
    description: 'Created a predictive model to forecast customer behavior and optimize sales strategies.',
    link: 'https://github.com/your-repo/sales-prediction',
    image: 'https://via.placeholder.com/400x150?text=Sales+Prediction'
  },
  {
    title: 'Credit Card Fraud Detection',
    description: 'Built a model to detect fraudulent transactions using advanced machine learning algorithms.',
    link: 'https://github.com/your-repo/credit-card-fraud-detection',
    image: 'https://via.placeholder.com/400x150?text=Credit+Card+Fraud+Detection'
  }
];

const Home = () => {
  return (
    <div className="home-container">
      <header className="home-header">
        <h1 className="home-title">Kavin Parikh</h1>
        <h2 className="home-subtitle">Data Analyst</h2>
        <p className="home-intro">
          Welcome to my portfolio! I am a Data Analyst with a Masterâ€™s degree in Computer Science from the University of Georgia. I specialize in transforming complex datasets into actionable insights using advanced data analysis techniques and machine learning models.
        </p>
        <Link to="/about" className="read-more-link">Read more about me</Link>
      </header>

      <section className="skills-section">
        <h2 className="section-title">Skills</h2>
        <div className="skills-list">
          {skills.map(skill => (
            <div key={skill.name} className="skill-item">
              <div className="skill-name">{skill.name}</div>
              <div className="skill-bar-background">
                <div className="skill-bar" style={{ width: `${skill.level}%` }}></div>
              </div>
            </div>
          ))}
        </div>
      </section>

      <section className="projects-section">
        <h2 className="section-title">Recent Projects</h2>
        <div className="projects-list">
          {projects.map(project => (
            <div key={project.title} className="project-card">
              <img src={project.image} alt={project.title} className="project-image" />
              <div className="project-content">
                <a href={project.link} target="_blank" rel="noopener noreferrer" className="project-title">
                  {project.title}
                </a>
                <p className="project-description">{project.description}</p>
              </div>
            </div>
          ))}
        </div>
      </section>

      <section className="contact-section">
        <h2 className="section-title">Get in Touch</h2>
        <p>If you'd like to collaborate or learn more about my work, feel free to <a href="mailto:kavinparikh20@gmail.com" className="contact-link">email me</a>.</p>
      </section>
    </div>
  );
};

export default Home;
